    "2016-02-26T22:01:45.717225",nt"name": "sequenceminer-algorithm",nt"isopen":
    true,nt"url": null,nt"notes": "Detecting and describing anomalies in large
    repositories of discrete symbol sequences.rnrn rnrn**sequenceMiner has been open-sourced!
    Download the  file below to try it out.**rnrn rnrnsequenceMiner was developed to
    address the problem of detecting and describing anomalies in large sets of high-dimensional
    symbol sequences. sequenceMiner works by performing unsupervised clustering (grouping)
    of sequences using the normalized longest common subsequence (LCS) as a similarity
    measure, followed by a detailed analysis of outliers to detect anomalies. sequenceMiner
    utilizes a new hybrid algorithm for computing the LCS that has been shown to outperform
    existing algorithms by a factor of five.rnrnsequenceMiner also includes new algorithms
    for outlier analysis that provide comprehensible indicators as to why a particular
    sequence was deemed to be an outlier. This provides analysts with a coherent description
    of the anomalies identified in the sequence, and why they differ from more u201cnormalu201d
    sequences.rnrn rnrnsequenceMiner was developed with funding from the NASA Aviation
    Safety Program.  In the commercial aviation domain, sequenceMiner can be used to
    discover atypical behavior in airline performance data that may have possible operational
    significance for safety analysts.  But because the sequenceMiner approach is general
    and not restricted in any way to a domain, and these algorithms can be applied in
    other fields where anomaly detection and event mining would be useful.",nt"license_title":
